export function repeatColors(colors, totalLength) {
    if (!Array.isArray(colors) || colors.length === 0) {
        throw new Error("Invalid colors array. It must be a non-empty array of hex strings.");
    }
    if (totalLength <= 0) {
        throw new Error("Total length must be a positive integer.");
    }

    return Array.from({ length: totalLength }, (_, i) => colors[i % colors.length]);
}

export function generateColorMapping(paletteName, items) {
    if (!categoricalPalettes[paletteName]) {
        throw new Error(`Palette "${paletteName}" not found.`);
    }
    
    const baseColors = categoricalPalettes[paletteName]; // Get the color list
    const expandedColors = repeatColors(baseColors, items.length); // Ensure enough colors

    const colorMap = new Map();
    items.forEach((item, index) => {
        colorMap.set(item, expandedColors[index]);
    });

    return colorMap;
}

export function valueToColor(paletteName, value, minValue, maxValue, centerValue = null) {
    // Determine if the palette is continuous or diverging
    const isDiverging = paletteName in DivergingPalettes;
    const palette = isDiverging ? DivergingPalettes[paletteName] : continousPalettes[paletteName];

    if (!palette) {
        throw new Error(`Palette "${paletteName}" not found in continuous or diverging palettes.`);
    }

    // Clip value within the given range
    if (value <= minValue) return palette[0]; // ✅ Return min color
    if (value >= maxValue) return palette[palette.length - 1]; // ✅ Return max color

    let index;

    if (isDiverging && centerValue !== null) {
        // Handle diverging palette mapping
        if (value === centerValue) {
            index = Math.floor(palette.length / 2);
        } else if (value < centerValue) {
            // Scale value between min and center
            const leftScale = (value - minValue) / (centerValue - minValue);
            index = Math.floor(leftScale * (palette.length / 2));
        } else {
            // Scale value between center and max
            const rightScale = (value - centerValue) / (maxValue - centerValue);
            index = Math.floor((palette.length / 2) + rightScale * (palette.length / 2));
        }
    } else {
        // Handle continuous palette mapping
        const scale = (value - minValue) / (maxValue - minValue);
        index = Math.floor(scale * (palette.length - 1));
    }

    // Ensure index is within valid range
    index = Math.max(0, Math.min(index, palette.length - 1));

    return palette[index];
}

